import React, { Component } from 'react';

class Contact extends Component {
    render() {
        return (
            <div style={{width: '100%', backgroundColor: 'blue', height: '100%', margin: '0', padding: '0'}}> 
                <h1>Contact Page</h1>
            </div>
        );
    }
};

export default Contact;
